    "contracts/MultiSignWalletFactory.sol": {
      "content": "// SPDX-License-Identifier: MIT

pragma solidity ^0.8.10;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/proxy/Clones.sol";
import "@openzeppelin/contracts/utils/structs/EnumerableSet.sol";

interface Init {
    function init(address[] memory owners, uint256 quorum) external;
}

contract MultiSignWalletFactory is Ownable {
    using EnumerableSet for EnumerableSet.AddressSet;

    event MasterWalletSet(address newMasterWallet);
    event WalletCreated(address indexed wallet, address indexed creator);
    event WalletOwnerAdded(address indexed wallet, address owner);
    event WalletOwnerRemoved(address indexed wallet, address owner);

    address public masterWallet;
    uint256 private nonce;

    EnumerableSet.AddressSet private wallets;
    mapping(address => EnumerableSet.AddressSet) private ownersMapping;

    constructor() {
        _transferOwnership(tx.origin);
    }

    modifier walletOnly() {
        require(wallets.contains(msg.sender), "caller not a Wallet");
        _;
    }

    function setMasterWallet(address newMasterWallet) external onlyOwner {
        masterWallet = newMasterWallet;
        emit MasterWalletSet(newMasterWallet);
    }

    function create(address[] memory owners, uint256 quorum) external {
        bytes32 salt = keccak256(abi.encodePacked(block.chainid, nonce++));
        address wallet = Clones.cloneDeterministic(masterWallet, salt);
        wallets.add(wallet);
        Init(wallet).init(owners, quorum);
        emit WalletCreated(wallet, msg.sender);
    }

    function onOwnerAdded(address owner) external walletOnly {
        ownersMapping[owner].add(msg.sender);
        emit WalletOwnerAdded(msg.sender, owner);
    }

    function onOwnerRemoved(address owner) external walletOnly {
        ownersMapping[owner].remove(msg.sender);
        emit WalletOwnerRemoved(msg.sender, owner);
    }

    function getAllWallets() external view returns (address[] memory) {
        address[] memory list = new address[](wallets.length());
        for (uint256 i; i < wallets.length(); i++) {
            list[i] = wallets.at(i);
        }
        return list;
    }

    function getWalletsByOwner(address owner)
        external
        view
        returns (address[] memory)
    {
        address[] memory list = new address[](ownersMapping[owner].length());
        for (uint256 i; i < ownersMapping[owner].length(); i++) {
            list[i] = ownersMapping[owner].at(i);
        }
        return list;
    }
}
"
